import React, { useState } from "react";

function HookCounter() {
  const [count, SetCount] = useState(0);
  return (
    <div>
      <h1>Count - {count}</h1>
      <button onClick={() => SetCount(count + 1)}>Click Me!</button>
    </div>
  );
}

export default HookCounter;
